import React from 'react';

const Text = (props) =>{
    const style = {
        display : 'inline-block',
        padding : '16px',
        textAlign : 'center',
        margin : '16px',
        border : '1px solid black'
     }

    return(
        <div>
            { props.textLength > 5 ?
            <h4>Text length is enough</h4>
         : 
        <h4>Text length is short</h4>
        }  
        <h1>{props.textLength}</h1>
        <button>Zic</button>
        </div>
    )
}

export default Text;
